    render() {
        return (
       <div className="right-item-cat" style={{width: '65%'}}>
  <div className="row">
  <ItemProduct/>
  <ItemProduct/>
   <ItemProduct/>
  </div>
   <div className="list-pages">
    <a href="#">1</a>
    <a href="#">2</a>
    <a href="#">3</a>
    <a href="#">4</a>
    <a href="#">5</a>
  </div>
</div>
        )
    }
}
const mapStateToProps=(state)=>{
    return{
        products:state.products
    }
}
export default  connect(mapStateToProps,null)(MainRight);
